    return (
        <>
            <header className="header">
                <img className="site-logo" src='/static/logo.png'/>
                <div className={`menu-container ${menuActive && 'active'}`}>
                    <Navigation/>
                </div>

                <svg src="/static/ui/hamburger-icon.svg" className="menu-icon" onClick={()=> setMenuActive(!menuActive)}/>
            </header>

